def stop(self):
    if self.max is not None:
        self.update(self.max)
    self.done = True

def run(self) -> None:
    while not self.done.wait(1 / self.refresh_per_second):
        with self.live._lock:
            if not self.done.is_set():
                self.live.refresh()

